import EditProduct from './components/EditProduct';
import EditOrder from './components/EditOrder';
import AdminDashboard from './components/AdminDashboard';
import OrderList from './components/OrderList';
import AddProduct from './components/AddProduct';
import ProductList from './components/ProductList';
import React from 'react';
import './App.css';
import Navbar from './components/Navbar';
import { BrowserRouter as Router, Routes, Route, useParams } from 'react-router-dom';
import Login from './components/Login';
import Register from './components/Register';
import NotFound from './components/NotFound';
import Footer from './components/Footer';


function EditProductWrapper() {
  const { id } = useParams();
  return <EditProduct productId={id} />;
}

function EditOrderWrapper() {
  const { id } = useParams();
  return <EditOrder orderId={id} />;
}


function App() {
  return (
    <Router>
      <Navbar />
      <div className="container">
        <Routes>
          <Route path="/" element={<div>Welcome to CloudCommerce</div>} />
          <Route path="/products" element={<ProductList />} />
          <Route path="/add-product" element={<AddProduct />} />
          <Route path="/orders" element={<OrderList />} />
          <Route path="/admin" element={<AdminDashboard />} />
          <Route path="/edit-product/:id" element={<EditProductWrapper />} />
          <Route path="/edit-order/:id" element={<EditOrderWrapper />} />
          <Route path="/login" element={<Login />} />
          <Route path="/register" element={<Register />} />
          <Route path="*" element={<NotFound />} />
        </Routes>
      </div>
      <Footer />
    </Router>
  );
}

export default App;
